script: |
  super -f text -I q10888.spq | sort > q10888.out

inputs:
  - name: q10888.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN - col1 + + col0 - - col0 * + col1 AND 66 + col0 * 82 / - 22 * + 8 + - - col1 + CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q10888.out
    data: |
